import "../style/components/User.css";

const User = ({ name, username, website }) => {
  return (
    <div className="user-card">
      <img></img>
      <h1>{name}</h1>
      <h3>{username}</h3>
      <a href={website}>{website}</a>
    </div>
  );
};

export default User;
